import './Expenses.css'
import Card from './Card';
import ExpenseItem from "./ExpenseItem";

function Expenses(itemProps) {
    
    return (
        <Card className="expenses">
            <div>dojdad</div>
            {/*"itemProps.items" replaces declaring a "const expenses = itemProps.items"*/}
            {itemProps.items.map((expense, index) => (
                <ExpenseItem
                    key={index}
                    title={expense.title}
                    price={expense.price}
                    date={expense.date}
                />
            ))}
        </Card>
    )
}

export default Expenses
